import {
  OUTREACH_SUCCESS,
  OUTREACH_ERROR
} from "../../helpers/constants";
import { dashboardInitial } from "../InitialState"

const dashboard = (state, { payload, type }) => {
  switch (type) {
    case OUTREACH_SUCCESS:
      console.log("State check!!:", state)
      return {
        ...state,
        outreachData: payload
      }
    case OUTREACH_ERROR:
      return {
        ...state,
        auth: {
          ...state.auth,
          loading: false,
          error: payload,
        },
      }
    default:
      return state;
  }
};

export default dashboard;
